script: |
  super -f text -I q4410.spq | sort > q4410.out

inputs:
  - name: q4410.spq
    data: |
      SELECT DISTINCT + 9 * + COUNT ( * ) AS col1, 23 + - COUNT ( * ) col0 FROM tab1 (FORMAT parquet) AS cor0 CROSS JOIN tab2 (FORMAT parquet) AS cor1;
  - name: tab1
  - name: tab2

outputs:
  - name: q4410.out
    data: |
      81	14
